import React from 'react';
import logo from './logo.svg';
import './App.css';
import Hello from './components/Hello';
import GreetFunction from './components/GreetFunction';
import GreetProps from './components/GreetProp';
import GreetConst from './components/GreetConst';
import WelcomeClass from './components/WelcomeClass';
import WelcomeClassProps from './components/WelcomeClassProps';
import MessageMessageClass from './components/MessageClass';
import MessageClass from './components/MessageClass';
import CounterClass from './components/CounterClass';

function App() {
  return (
    <div className="App">
      <MessageClass></MessageClass>
      <GreetFunction />
      <GreetConst/>
      <WelcomeClass />      
      <Hello></Hello>
      <GreetProps name="Ram" heroName='God Ram'/>
      <p>This is children props.</p>
      <GreetProps name="Lakhan" heroName="Ram's second brother"/>
      <button>Action</button>
      <GreetProps name="Bharat" heroName="Ram's third brother"/>
      <WelcomeClassProps  name="Ram" heroName='God Ram'></WelcomeClassProps>
      <WelcomeClassProps  name="Lakhan" heroName="Ram's second brother"></WelcomeClassProps>
    </div>
  );
}

export default App;
